DROP TABLE `STUDENT`;

CREATE TABLE `STUDENT` (
  `id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
  `nume_nastere` varchar(255) default NULL,
  `nume_actual` varchar(255) default NULL,
  `prenume` varchar(255) default NULL,
  `prenume_tata` varchar(255) default NULL,
  `prenume_mama` varchar(255) default NULL,
  `cnp` varchar(13) default NULL,
  `sexul` varchar(255) default NULL,
  `data_nastere` varchar(255),
  `tara_nastere` varchar(255) default NULL,
  `judet_nastere` varchar(255) default NULL,
  `localitate_nastere` varchar(255) default NULL,
  `cetatenie` varchar(255) default NULL,
  `nationalitate` varchar(255) default NULL,
  `etnie` varchar(255) default NULL,
  `limba_materna` varchar(255) default NULL,
  `stare_civila` varchar(255) default NULL,
  `date_CI` varchar(255) default NULL,
  `date_pasaport` varchar(255) default NULL,
  `adresa` varchar(255) default NULL,
  `cazare_studii` varchar(255) default NULL,
  `cazare_admitere` varchar(255) default NULL,
  `stare_sociala_speciala` varchar(255) default NULL,
  `dizabilitati` varchar(255) default NULL,
  `telefon` varchar(100) default NULL,
  `NOTA_BAC_MAX` mediumint default NULL,
  `medie_admitere` mediumint default NULL,
  `preferintaSTUDENT_cnp` varchar(13) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

